import React, {Component} from "react";
import "../../styles/components/_error.scss";
import Mug from "./public/cute_mug_sad.svg";

class ErrorPopup extends Component {
    render () {
        return (
            <div className="error">
                <div className="error_container">
                    <div className="error_container__logo">
                        <Mug />
                    </div>
                    <div className="error_container__header">
                        <h1 className="error_container__header--title">
                            Uh, oh :(
                        </h1>
                    </div>
                    <div className="error_container__description">
                        <span className="error_container__description--text">
                            We're sorry, but something went wrong.
                        </span>
                    </div>
                </div>
            </div>
        );
    }
}

export default ErrorPopup;
